import React from "react";
import {
  View,
  Text,
  StyleSheet,
  Image,
  TouchableOpacity,
  ScrollView,
  FlatList,
} from "react-native";

const Categories = (props) => {
  return (
    <View style={styles.Container}>
      <Text>Categories</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default Categories;
